import './App.css';
const data = {
  player_name: "John Doe", 
  score: 1 
}
function App() {

  const test = () => {
   fetch('http://localhost:4200/appuser', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify(data)
  })
}


  return (
    <div className="App">
      <button onClick={test}>CLICK</button>
    </div>
  );
}

export default App;
